import React, { useState, useEffect } from 'react';
import './Dashboard.css';
import AdminPanel from './AdminPanel';
import DataVisualization from './DataVisualization';
import LogsNavigation from './LogsNavigation';
import ManagerView from './ManagerView';
import LeadView from './LeadView';
import ProjectFilter from './ProjectFilter';
import SlideBar from './SlideBar';
import { LineChart, Line, BarChart, Bar, PieChart, Pie, Cell, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer, AreaChart, Area } from 'recharts';

const Dashboard = ({ user, onLogout }) => {
  const [activeView, setActiveView] = useState('engineer');
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);
  const [sidebarActiveView, setSidebarActiveView] = useState(null);
  const [projectFilters, setProjectFilters] = useState({
    domain_id: '',
    project_id: ''
  });
  const [dateFilter, setDateFilter] = useState({
    startDate: new Date(Date.now() - 7 * 24 * 60 * 60 * 1000).toISOString().split('T')[0], // 7 days ago
    endDate: new Date().toISOString().split('T')[0] // today
  });
  const [dashboardStats, setDashboardStats] = useState({
    totalProjects: 0,
    activeRuns: 0,
    completedRuns: 0,
    failedRuns: 0,
    totalUsers: 0,
    recentActivity: []
  });
  const [chartData, setChartData] = useState({
    runTrends: [],
    statusDistribution: [],
    projectPerformance: [],
    weeklyStats: []
  });

  const token = localStorage.getItem('token');

  // Fetch dashboard stats only once on component mount (unfiltered)
  useEffect(() => {
    fetchDashboardStats();
  }, []);

  // Fetch chart data when date filter changes (filtered)
  useEffect(() => {
    fetchChartData();
  }, [dateFilter]);

  const fetchDashboardStats = async () => {
    try {
      // Fetch stats without date filter - showing overall totals
      const response = await fetch(`http://localhost:5000/api/data/dashboard-stats`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setDashboardStats(data);
      }
    } catch (error) {
      console.error('Error fetching dashboard stats:', error);
    }
  };

  const fetchChartData = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/data/chart-data?startDate=${dateFilter.startDate}&endDate=${dateFilter.endDate}`, {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        setChartData(data);
      }
    } catch (error) {
      console.error('Error fetching chart data:', error);
    }
  };

  const handleDateFilterChange = (field, value) => {
    setDateFilter(prev => ({
      ...prev,
      [field]: value
    }));
  };

  const resetDateFilter = () => {
    setDateFilter({
      startDate: new Date(Date.now() - 7 * 24 * 60 * 60 * 1000).toISOString().split('T')[0],
      endDate: new Date().toISOString().split('T')[0]
    });
  };

  const handleProjectFilterChange = (newFilters) => {
    setProjectFilters(newFilters);
    // Reset active view when filters change
    setActiveView('engineer');
  };

  const handleSidebarViewChange = (view) => {
    setSidebarActiveView(view);
    setActiveView(view);
  };

  const getAvailableViews = () => {
    const views = [];

    // Only show project views if a domain is selected
    if (projectFilters.domain_id) {
      views.push(
        { id: 'engineer', label: 'Engineer View', icon: 'âš™ï¸' },
        { id: 'lead', label: 'Lead View', icon: 'ðŸ‘¥' },
        { id: 'manager', label: 'Manager View', icon: 'ðŸ“ˆ' }
      );
    }

    // Always show admin and logs for admin users
    if (user?.role_name === 'Admin') {
      views.push(
        { id: 'admin', label: 'Admin Panel', icon: 'ðŸ‘‘' },
        { id: 'logs', label: 'Logs', icon: 'ðŸ“' }
      );
    }

    return views;
  };

  const renderDashboardContent = () => {
    // If no domain is selected and not viewing admin/logs, show a message to select filters
    if (!projectFilters.domain_id && !['admin', 'logs'].includes(activeView)) {
      return (
        <div className="no-filters-selected">
          <div className="no-filters-content">
            <div className="no-filters-icon">ðŸ”</div>
            <h2>Select Project Filters</h2>
            <p>Please select a domain and project from the filters above to view the dashboard content.</p>
          </div>
        </div>
      );
    }

    switch (activeView) {
      case 'engineer':
        return <DataVisualization projectFilters={projectFilters} />;
      case 'lead':
        return <LeadView user={user} projectFilters={projectFilters} />;
      case 'manager':
        return <ManagerView user={user} projectFilters={projectFilters} />;
      case 'admin':
        return <AdminPanel />;
      case 'logs':
        return <LogsNavigation />;
      default:
        return <DataVisualization projectFilters={projectFilters} />;
    }
  };

  return (
    <div className="dashboard-container">
      {/* Top Navigation Bar */}
      <nav className="top-navbar">
        <div className="navbar-container">
          {/* Logo and Brand */}
          <div className="navbar-brand">
            <div className="logo-icon">
              <svg width="24" height="24" viewBox="0 0 24 24" fill="none">
                <path d="M3 13h8V3H3v10zm0 8h8v-6H3v6zm10 0h8V11h-8v10zm0-18v6h8V3h-8z" fill="currentColor"/>
              </svg>
            </div>
            <h3>EDA Dashboard</h3>
          </div>

          {/* Navigation Menu */}
          <div className={`navbar-menu ${mobileMenuOpen ? 'open' : ''}`}>
            {getAvailableViews().map((view) => (
              <button
                key={view.id}
                className={`nav-item ${activeView === view.id ? 'active' : ''}`}
                onClick={() => {
                  setActiveView(view.id);
                  setMobileMenuOpen(false);
                }}
              >
                <span className="nav-icon">{view.icon}</span>
                <span className="nav-label">{view.label}</span>
              </button>
            ))}
          </div>

          {/* User Section */}
          <div className="navbar-user">
            <div className="user-info">
              <div className="user-avatar">
                {user?.name?.charAt(0).toUpperCase()}
              </div>
              <div className="user-details">
                <div className="user-name">{user?.name}</div>
                <div className="user-role">{user?.role_name}</div>
              </div>
              <button onClick={onLogout} className="logout-btn">
                <svg width="16" height="16" viewBox="0 0 24 24" fill="none">
                  <path d="M17 7l-1.41 1.41L18.17 11H8v2h10.17l-2.58 2.58L17 17l5-5zM4 5h8V3H4c-1.1 0-2 .9-2 2v14c0 1.1.9 2 2 2h8v-2H4V5z" fill="currentColor"/>
                </svg>
                Logout
              </button>
            </div>

            {/* Tools Button for Admin */}
            {user?.role_name === 'Admin' && (
              <button onClick={toggleSlideBar} className="tools-btn">
                <svg width="20" height="20" viewBox="0 0 24 24" fill="none">
                  <path d="M19.14,12.94c0.04-0.3,0.06-0.61,0.06-0.94c0-0.32-0.02-0.64-0.07-0.94l2.03-1.58c0.18-0.14,0.23-0.41,0.12-0.61 l-1.92-3.32c-0.12-0.22-0.37-0.29-0.59-0.22l-2.39,0.96c-0.5-0.38-1.03-0.7-1.62-0.94L14.4,2.81c-0.04-0.24-0.24-0.41-0.48-0.41 h-3.84c-0.24,0-0.43,0.17-0.47,0.41L9.25,5.35C8.66,5.59,8.12,5.92,7.63,6.29L5.24,5.33c-0.22-0.08-0.47,0-0.59,0.22L2.74,8.87 C2.62,9.08,2.66,9.34,2.86,9.48l2.03,1.58C4.84,11.36,4.8,11.69,4.8,12s0.02,0.64,0.07,0.94l-2.03,1.58 c-0.18,0.14-0.23,0.41-0.12,0.61l1.92,3.32c0.12,0.22,0.37,0.29,0.59,0.22l2.39-0.96c0.5,0.38,1.03,0.7,1.62,0.94l0.36,2.54 c0.05,0.24,0.24,0.41,0.48,0.41h3.84c0.24,0,0.44-0.17,0.47-0.41l0.36-2.54c0.59-0.24,1.13-0.56,1.62-0.94l2.39,0.96 c0.22,0.08,0.47,0,0.59-0.22l1.92-3.32c0.12-0.22,0.07-0.47-0.12-0.61L19.14,12.94z M12,15.6c-1.98,0-3.6-1.62-3.6-3.6 s1.62-3.6,3.6-3.6s3.6,1.62,3.6,3.6S13.98,15.6,12,15.6z" fill="currentColor"/>
                </svg>
                Tools
              </button>
            )}
          </div>

          {/* Mobile Menu Toggle */}
          <button 
            className="mobile-menu-toggle"
            onClick={() => setMobileMenuOpen(!mobileMenuOpen)}
            aria-label="Toggle mobile menu"
          >
            <svg width="24" height="24" viewBox="0 0 24 24" fill="none">
              <path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z" fill="currentColor"/>
            </svg>
          </button>
        </div>
      </nav>

      {/* Main Content Area */}
      <div className="main-content">
        {/* Project Filters */}
        <div className="filters-section">
          <ProjectFilter 
            onFilterChange={handleProjectFilterChange}
            selectedFilters={projectFilters}
          />
        </div>

        {/* Content header for all views */}
        <header className="content-header">
          <div className="header-content">
            <div className="header-left">
              <h1>{getAvailableViews().find(v => v.id === activeView)?.label || 'Dashboard'}</h1>
            </div>
            <div className="header-actions">
              {/* Additional header actions can be added here */}
            </div>
          </div>
        </header>
        <main className="content-body">
          {renderDashboardContent()}
        </main>
      </div>

      {/* Slide Bar */}
      <SlideBar 
        isOpen={slideBarOpen}
        onClose={() => setSlideBarOpen(false)}
        activeView={activeView}
        user={user}
      />
    </div>
  );
};

